"<div>\n<i class=\"NoteType\">\nHenkil\u00f6n lis\u00e4tietoja\n</i>\n<div class=\"grampsstylednote\">\n<p>\nMarcus Kratzin vanhemmista on tietoa, joskin varauksella. Sotilasasiakirjoissa h\u00e4nell\u00e4 on patronyymi Ericsson, mutta kastetapahtumassa is\u00e4 on Johan Michelsson, joka kuoli Suomelassa 1.3.1762, ja \u00e4iti Maria Sigfridi j\u00e4i leskeksi. Rippikirjassa 1773-1784 Raikun Siurolassa on ilman syntym\u00e4aikaa Marcus, jonka patronyymi Joh. on yliviivattu ja kirjoitettu uusi patronyymi Erici. Avioliiton aikana 1778- Vehoniemess\u00e4 on m\u00e5g Marcus Johanis Kratz.\n</p>\n<p>\n&nbsp;\n</p>\n</div>\n</div>",
